import PlayPage from './pages/PlayPage.js';

function Body( showPlayPage, showProfilePage, showSettingsPage ) {

    return(
        <div>
            <div>
                {showPlayPage && <PlayPage />}
            </div>
            <div>
                {showProfilePage && <ProfilePage />}
            </div>
            <div>
                {showPlayPage && <PlayPage />}
            </div>
        </div>
    );
    
}

export default Body;
